sparql:
SELECT (COUNT(DISTINCT ?x) AS ?count)
WHERE {
?x0 <https://raw.githubusercontent.com/adhollander/FSLschemas/main/fsisupp.owl#taxa> "California least tern" .
?x0 <https://raw.githubusercontent.com/adhollander/FSLschemas/main/fsisupp.owl#infrastructureAdjacent> ?x .
?x a <https://raw.githubusercontent.com/adhollander/FSLschemas/main/sustsource.owl#Infrastructure> .
}

SELECT (COUNT(DISTINCT ?x) AS ?count)
WHERE {
?x0 <http://www.w3.org/2004/02/skos/core#altLabel> "Point Reyes Bird Observatory, PRBO" .
?x <https://raw.githubusercontent.com/adhollander/FSLschemas/main/fsisupp.owl#leadOrg> ?x0 .
?x a <http://vivoweb.org/ontology/core#Project> .
}

SELECT DISTINCT ?x
WHERE {
?x0 <http://www.w3.org/2004/02/skos/core#altLabel> "JMIE, John Muir Institute of the Environment" .
?x0 <http://purl.org/dc/terms/isPartOf> ?x .
?x a <http://xmlns.com/foaf/0.1/Organization> .
}

SELECT DISTINCT ?x
WHERE {
?x <https://raw.githubusercontent.com/adhollander/FSLschemas/main/fsisupp.owl#assocGeo> "Middle Fork American River" .
?x a <https://raw.githubusercontent.com/adhollander/FSLschemas/main/sustsource.owl#Infrastructure> .
}

SELECT DISTINCT ?x
WHERE {
?x <http://purl.org/dc/terms/references> "Used in Southern California Wetlands Recovery Project" .
?x a <http://www.sdsconsortium.org/schemas/sds-okn.owl#Tool> .
}
